import React, { useRef } from 'react';
import { useEffect, useState } from 'react';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
} from 'chart.js';
import './App.css';
import { BarGraph } from './component/Bar';

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip
);

interface graphInterface {
  id: number,
  velocity: number
}

function App() {

  const c: graphInterface = {
    id: 0,
    velocity: 0
  }
  const [data, setData] = useState<graphInterface[]>([c])
  const result = fetch('http://127.0.0.1:8000/velocity/users').then(resp => resp.json()).then(json => setData(json))
  const [x, setX] = useState<number[]>(data.map(d => d.id))
  const [y, setY] = useState<number[]>(data.map(d => d.velocity))

  useEffect(() => {
    setX(data.map(d => d.id))
    setY(data.map(d => d.velocity))
  }, [data])


  return (
    <div className="App">
      Iteration Data
      <div>
        <BarGraph
          id={x}
          velocity={y} />
      </div>

    </div>
  );
}

export default App;
